INSERT INTO `nav_links` VALUES ('7463', 'fouber的前端工程专题', 'http://www.kancloud.cn/digest/fis/61586', '或许现在很多企业和团队尚未重视前端工程，或许前端工程在很多人眼里还只是“构建工具”的代名词，又或许未来前端领域的变革使得一切工程问题从根本上得到解决。不管怎样，我只是希望当下能认真的记录自己在前端工程领域的所见所想，与正在经历前端工程化改进，并被此过程困扰的同学交流心得。', null, null, null, '0', '2', '0', '0', 'N', '0');
INSERT INTO `nav_links` VALUES ('7464', 'Backbone.js入门教程第二版', 'http://www.kancloud.cn/kancloud/backbonejs-learning-note/49378', 'Backbone.js提供了一套web开发的框架，通过Models进行key-value绑定及自定义事件处理，通过Collections提供一套丰富的API用于枚举功能，通过Views来进行事件处理及与现有的Application通过RESTful JSON接口进行交互.它是基于jQuery和underscore的一个前端js框架。', null, null, null, '0', '2', '0', '0', 'N', '0');
